import 'bootstrap/dist/css/bootstrap.css';
import { AnimatePresence } from 'framer-motion';
import { urlObjectKeys } from 'next/dist/next-server/lib/utils';

export default ({ Component, pageProps, router }) => {
  return (
    <div
      className="container-fluid bg-success d-flex justify-content-center align-items-center p-5"
      style={{
        height: '100vh',
        backgroundImage:
          "url('https://images.unsplash.com/photo-1531736275454-adc48d079ce9?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1950&q=80')",
      }}
    >
      <AnimatePresence exitBeforeEnter>
        <Component {...pageProps} key={router.route} />
      </AnimatePresence>
    </div>
  );
};
